export default {
  "plugins": [],
  "themes": [],
  "customFields": {},
  "themeConfig": {
    "prism": {
      "theme": {
        "plain": {
          "color": "#F8F8F2",
          "backgroundColor": "#282A36"
        },
        "styles": [
          {
            "types": [
              "prolog",
              "constant",
              "builtin"
            ],
            "style": {
              "color": "rgb(189, 147, 249)"
            }
          },
          {
            "types": [
              "inserted",
              "function"
            ],
            "style": {
              "color": "rgb(80, 250, 123)"
            }
          },
          {
            "types": [
              "deleted"
            ],
            "style": {
              "color": "rgb(255, 85, 85)"
            }
          },
          {
            "types": [
              "changed"
            ],
            "style": {
              "color": "rgb(255, 184, 108)"
            }
          },
          {
            "types": [
              "punctuation",
              "symbol"
            ],
            "style": {
              "color": "rgb(248, 248, 242)"
            }
          },
          {
            "types": [
              "string",
              "char",
              "tag",
              "selector"
            ],
            "style": {
              "color": "rgb(255, 121, 198)"
            }
          },
          {
            "types": [
              "keyword",
              "variable"
            ],
            "style": {
              "color": "rgb(189, 147, 249)",
              "fontStyle": "italic"
            }
          },
          {
            "types": [
              "comment"
            ],
            "style": {
              "color": "rgb(98, 114, 164)"
            }
          },
          {
            "types": [
              "attr-name"
            ],
            "style": {
              "color": "rgb(241, 250, 140)"
            }
          }
        ]
      }
    },
    "navbar": {
      "title": "",
      "logo": {
        "alt": "",
        "src": "img/Logo_orangenerHG.png"
      },
      "prism": {
        "theme": {
          "plain": {
            "color": "#393A34",
            "backgroundColor": "#f6f8fa"
          },
          "styles": [
            {
              "types": [
                "comment",
                "prolog",
                "doctype",
                "cdata"
              ],
              "style": {
                "color": "#999988",
                "fontStyle": "italic"
              }
            },
            {
              "types": [
                "namespace"
              ],
              "style": {
                "opacity": 0.7
              }
            },
            {
              "types": [
                "string",
                "attr-value"
              ],
              "style": {
                "color": "#e3116c"
              }
            },
            {
              "types": [
                "punctuation",
                "operator"
              ],
              "style": {
                "color": "#393A34"
              }
            },
            {
              "types": [
                "entity",
                "url",
                "symbol",
                "number",
                "boolean",
                "variable",
                "constant",
                "property",
                "regex",
                "inserted"
              ],
              "style": {
                "color": "#36acaa"
              }
            },
            {
              "types": [
                "atrule",
                "keyword",
                "attr-name",
                "selector"
              ],
              "style": {
                "color": "#00a4db"
              }
            },
            {
              "types": [
                "function",
                "deleted",
                "tag"
              ],
              "style": {
                "color": "#d73a49"
              }
            },
            {
              "types": [
                "function-variable"
              ],
              "style": {
                "color": "#6f42c1"
              }
            },
            {
              "types": [
                "tag",
                "selector",
                "keyword"
              ],
              "style": {
                "color": "#00009f"
              }
            }
          ]
        }
      },
      "links": [
        {
          "to": "docs/benchmarks/intro",
          "label": "Benchmarks",
          "position": "left"
        },
        {
          "to": "docs/about/team",
          "label": "About",
          "position": "left"
        },
        {
          "href": "https://github.com/",
          "label": "GitHub",
          "position": "right"
        },
        {
          "to": "docs/guides/basic-definitions",
          "label": "Guides",
          "position": "left"
        },
        {
          "to": "docs/experiments/experiment1",
          "label": "Experiments",
          "position": "left"
        }
      ]
    },
    "footer": {
      "style": "dark",
